        <div className="h-full w-full flex justify-center items-center">
            <div className="flex w-3/5 h-3/5 bg-gray-900 rounded-lg text-white">
                <div className="flex flex-col w-1/2 px-8 py-8">
                    <p className="text-3xl">Laten we kijken of we samen wat moois kunnen maken!</p>
                    <p><MailOutlined />&nbsp;&nbsp;&nbsp;&nbsp;info@vkvrestauraties.nl</p>
                </div>
                <div className="w-1/2">

                </div>
            </div>
        </div>
    );
}

export default Contact;
